import React from 'react';
import { Button, Form, Grid, Header, Image, Message, Segment } from 'semantic-ui-react';
import styles from './LandingPage.module.css'

export class LandingPage extends React.Component<{}, {}> {
  render() {
    return (
      <>
        <Grid centered>
          <Segment very padded >
            <Button>
              Sign Up
            </Button>
            <Button>
              Login
            </Button>
          </Segment>
        </Grid>


      </>
    )
  }
};
